message:
Você conhece a PTfobia? 🧟‍♂️ Ela é consequência dos traumas que o governo PT deixou pra nós mineiros:

😨 Dívida de R$ 150 bilhões, sendo R$ 30bi de curto prazo;
🤬Servidor público com salário atrasado;
😡 853 Prefeituras mineiras sem verbas da saúde e educação;
🤯 Corte de recursos da assistência social;
🤒 Abandono dos hospitais regionais e diversas outras obras;
😱 Escolas mal cuidadas e com merenda de baixa qualidade;
😳 Saldo de 200 mil desempregados;
👺 E muito mais!

A companheirada que levou o Estado pro vermelho já foi deixada no passado pelos mineiros no 1º turno. 🔺 Agora, pra tragédia não se repetir no Brasil, no 2º turno pra Presidente vote em quem vai manter os fantasmas do passsado no seu devido lugar. 🇧🇷🚀 #SaiPraLáAssombração #PTnuncaMais
